<p>因为简洁、高效、易读、易写的特点，Markdown 被大量使用，如 <a href="https://github.com/" target="_blank" rel="noopener noreferrer">Github</a>、<a href="https://www.wikipedia.org/" target="_blank" rel="noopener noreferrer">Wikipedia</a> 等网站。当然他也不仅限在网站上使用，像 <a href="https://code.visualstudio.com/" target="_blank" rel="noopener noreferrer">VSCode</a>、<a href="https://typoraio.cn/" target="_blank" rel="noopener noreferrer">Typora</a> 等软件也同样支持使用 Markdown 来编写你的文档。</p>
